/**
* Oracle Script to populate a Database with data which we can
* use to test Amforeas.
*/

CREATE SEQUENCE amforeas_demo.users_id_sequence MINVALUE 1;
CREATE SEQUENCE amforeas_demo.maker_id_sequence MINVALUE 1;
CREATE SEQUENCE amforeas_demo.car_id_sequence MINVALUE 1;
CREATE SEQUENCE amforeas_demo.comments_id_sequence MINVALUE 1;
CREATE SEQUENCE amforeas_demo.pictures_id_sequence MINVALUE 1;
CREATE SEQUENCE amforeas_demo.sales_stats_id_sequence MINVALUE 1;
CREATE SEQUENCE amforeas_demo.maker_stats_id_sequence MINVALUE 1;

CREATE TABLE amforeas_demo.users (
    id NUMBER NOT NULL,
    name VARCHAR2(25) NOT NULL,
    age NUMBER,
    birthday DATE,
    lastupdate TIMESTAMP,
    credit DECIMAL(6,2),
    CONSTRAINT USERS_PK PRIMARY KEY (id) ENABLE
);

CREATE TABLE amforeas_demo.maker (
    id NUMBER NOT NULL,
    name VARCHAR(50),
    realname VARCHAR(50),
    CONSTRAINT maker_PK PRIMARY KEY (id) ENABLE
);

CREATE TABLE amforeas_demo.car (
    cid NUMBER NOT NULL,
    maker VARCHAR(50),
    model VARCHAR(25), 
    year INTEGER, 
    fuel VARCHAR(25), 
    transmission VARCHAR(25), 
    created DATE, 
    lastupdate TIMESTAMP, 
    currentMarketValue DECIMAL(10,2), 
    newValue DECIMAL(10,2), 
    CONSTRAINT car_PK PRIMARY KEY (cid) ENABLE
);

CREATE TABLE amforeas_demo.comments (
    id NUMBER NOT NULL,
    car_id INTEGER, 
    car_comment VARCHAR(255),
    CONSTRAINT comments_PK PRIMARY KEY (id) ENABLE
);

CREATE TABLE amforeas_demo.pictures (
    id NUMBER NOT NULL,
    car_id INTEGER, 
    picture VARCHAR(255),
    CONSTRAINT pictures_PK PRIMARY KEY (id) ENABLE
);

CREATE TABLE amforeas_demo.sales_stats (
    id NUMBER NOT NULL,
    year INTEGER, 
    month INTEGER, 
    sales INTEGER, 
    last_update DATE NOT NULL,
    CONSTRAINT sales_stats_PK PRIMARY KEY (id) ENABLE
);

CREATE TABLE amforeas_demo.maker_stats (
    id NUMBER NOT NULL,
    year INTEGER, 
    month INTEGER, 
    maker VARCHAR(50), 
    sales INTEGER, 
    last_update DATE NOT NULL,
    CONSTRAINT maker_stats_PK PRIMARY KEY (id) ENABLE
);

CREATE TABLE amforeas_demo.empty (
    id NUMBER NOT NULL,
    name VARCHAR(50), 
    realname VARCHAR(50),
    CONSTRAINT empty_PK PRIMARY KEY (id) ENABLE
);

CREATE TRIGGER amforeas_demo.users_trigger BEFORE INSERT ON amforeas_demo.users FOR EACH ROW BEGIN SELECT amforeas_demo.users_id_sequence.nextval INTO :new.id FROM dual; END;
/

CREATE TRIGGER amforeas_demo.maker_trigger BEFORE INSERT ON amforeas_demo.maker FOR EACH ROW BEGIN SELECT amforeas_demo.maker_id_sequence.nextval INTO :new.id FROM dual; END;
/

CREATE TRIGGER amforeas_demo.car_trigger BEFORE INSERT ON amforeas_demo.car FOR EACH ROW BEGIN SELECT amforeas_demo.car_id_sequence.nextval INTO :new.cid FROM dual; END;
/

CREATE TRIGGER amforeas_demo.comments_trigger BEFORE INSERT ON amforeas_demo.comments FOR EACH ROW BEGIN SELECT amforeas_demo.comments_id_sequence.nextval INTO :new.id FROM dual; END;
/

CREATE TRIGGER amforeas_demo.pictures_trigger BEFORE INSERT ON amforeas_demo.pictures FOR EACH ROW BEGIN SELECT amforeas_demo.pictures_id_sequence.nextval INTO :new.id FROM dual; END;
/

CREATE TRIGGER amforeas_demo.sales_stats_trigger BEFORE INSERT ON amforeas_demo.sales_stats FOR EACH ROW BEGIN SELECT amforeas_demo.sales_stats_id_sequence.nextval INTO :new.id FROM dual; END;
/

CREATE TRIGGER amforeas_demo.maker_stats_trigger BEFORE INSERT ON amforeas_demo.maker_stats FOR EACH ROW BEGIN SELECT amforeas_demo.maker_stats_id_sequence.nextval INTO :new.id FROM dual; END;
/


--SET TABLE maker READONLY TRUE;

CREATE FUNCTION amforeas_demo.simpleStoredProcedure RETURN NUMBER AS BEGIN RETURN 1; END;
/

CREATE PROCEDURE amforeas_demo.insert_comment (in_car_id IN NUMBER, in_car_comment IN VARCHAR2) AS BEGIN INSERT INTO amforeas_demo.comments (car_id, car_comment) VALUES (in_car_id, in_car_comment); END insert_comment;
/

CREATE PROCEDURE amforeas_demo.get_year_sales ( in_year IN INTEGER ,  out_total OUT INTEGER) AS BEGIN SELECT COUNT(sales) INTO out_total FROM amforeas_demo.sales_stats t WHERE t.year = in_year; END get_year_sales;
/

CREATE VIEW amforeas_demo.MAKER_STATS_2010 AS SELECT month, sales, maker FROM amforeas_demo.maker_stats WHERE year = 2010;
